import "./Page2.css";

function Pages2() {
  return (
    <div className="app">
      <div className="bg2">
        <div>
          <button className="startButton" a href="/">
            Start
          </button>
        </div>
        <div>
          <button className="tutorialButton">Tutorial</button>
        </div>
        <div>
          <button className="exitButton">EXIT</button>
        </div>
      </div>
    </div>
  );
}

export default Pages2;
